package uz.gita.users_app.presenter.screens.mainimport uz.gita.users_app.data.model.UsersModelimport uz.gita.users_app.presenter.screens.detail.DetailScreenimport uz.gita.users_app.utils.navigation.AppNavigatorimport javax.inject.Injectinterface MainDirection {    suspend fun moveToDetail(model: UsersModel)}class MainDirectionImpl @Inject constructor(    private val appNavigator: AppNavigator,) : MainDirection {    override suspend fun moveToDetail(model: UsersModel) {        appNavigator.openWithSave(DetailScreen(model))    }}